public class Structure<E> { 
  private N<E> st = new N<E>(null, null); 
  private int s; 

  public void add(int i, E v) { 
    N<E> n = new N<E>(v, g(i)); 
    g(i - 1).n = n; 
    s++; 
  } 

  public E get(int i) { return g(i).d; } 

  public void remove(int i) { 
    g(i - 1).n = g(i).n; 
    s--; 
  } 

  public int size() { return s; } 

  private N<E> g(int i) { 
    N<E> t = st; 
    for(int j = -1; j < i; j++, t = t.n); 
    return t; 
  }     

  private static class N<E> { 
    private E d; 
    private N<E> n; 

    private N(E d1, N<E> n1) { 
      d = d1; 
      n = n1; 
    } 
